func Count() string {
	zs := 0
	yx := 0
	wx := 0
	tl := 0
	ts := 0
	tc := 0
	dt := Date()
	cks := GetJdCookies()
	for _, ck := range cks {
		zs++
		if ck.Available == True {
			yx++
		} else {
			wx++
		}
		if ck.CreateAt == dt {
			tc++
		}
	}
	jps := []JdCookiePool{}
	db.Find(&jps)
	for _, jp := range jps {
		if jp.CreateAt == dt {
			ts++
		}
		if jp.LoseAt == dt {
			tl++
		}
	}
	return fmt.Sprintf("总数%d,有效%d,无效%d,今日失效%d,今日扫码%d,今日新增%d", zs, yx, wx, tl, ts, tc)
}
